import React from 'react';
import './About.css';

export default function About(){
    return (
        <section id="about">
            <div className="about-container">
                <h1 className="big-text">Our Goal</h1>
                <h2>At CSES, we aim to form a passionate community of computer scientists and engineers
                    at UC San Diego. From tech talks, to social events, to outreach, we have a diver set of events
                    and activities that appeal to any computer scientist or engineer.</h2>
            </div>
        </section>

    );
}
